import React, { useState, useEffect } from 'react';
import { fetchTenants } from '../api';
import api from '../api/api';

const TenantList = () => {
    const [tenants, setTenants] = useState([]);

    useEffect(() => {
        const fetchAllTenants = async () => {
            try {
                const allTenants = await fetchTenants();
                setTenants(allTenants);
            } catch (error) {
                console.error('Erreur lors de la récupération des locataires :', error);
            }
        };

        fetchAllTenants();
    }, []);

    return (
        <div className="tenant-list-container">
            <h2>Liste des locataires</h2>
            <ul>
                {tenants.map((tenant) => (
                    <li key={tenant.id}>
                        {tenant.firstName} {tenant.lastName} - {tenant.apartment}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default TenantList;
